from Bio.Seq import Seq

# 역방향 상보 서열 확인
original_seq = Seq("")
reverse_complement_seq = original_seq.reverse_complement()

Refseq = Seq("")

# 두 값이 같은지 비교
is_equal = reverse_complement_seq == Refseq

# 결과 출력
print("두 값이 같은가:", is_equal)
print("reverse_complement_seq 길이:", len(reverse_complement_seq))
print("Refseq 길이:", len(Refseq))
